import styled from "styled-components"
import bbg from "./img/"

function App() {
	const AppStyled = styled.div`
		height: 100vh;
		background-image: url(bg);
	`

	return (
		<AppStyled className="App">
			<div>
				<h1>Expense Tracker</h1>
			</div>
		</AppStyled>
	)
}

export default App
